class ImageWinViewer : public AppCUI::Controls::Window
{
    ImageViewer iv;

  public:
    ImageWinViewer(const AppCUI::Graphics::Image& img)
    {
        this->Create("Image view", "a:c,w:100%,h:100%");
        iv.Create(this, "x:0,y:0,w:100%,h:100%");
        iv.SetImage(img, ImageRendererMode::SmallBoxes);
    }
    bool OnEvent(Control* sender, Event eventType, int controlID) override
    {
        if (eventType == Event::EVENT_WINDOW_CLOSE)
        {
            this->Exit(0);
            return true;
        }
        return false;
    };
};

class MainWin : public AppCUI::Controls::Window
{
    Button dizzy;

  public:
    MainWin()
    {
        this->Create("Image example", "a:c,w:40,h:10");
        dizzy.Create(this, "Show Dizzy image !", "x:1,y:1,w:36", BTN_SHOW_DIZZY);
    }
    bool OnEvent(Control* sender, Event eventType, int controlID) override
    {
        if (eventType == Event::EVENT_WINDOW_CLOSE)
        {
            Application::Close();
            return true;
        }
        if (eventType == Event::EVENT_BUTTON_CLICKED)
        {
            if (controlID == BTN_SHOW_DIZZY)
            {
                AppCUI::Graphics::Image img;
                img.Create(256,192); // ZX Spectrum screen size
                memcpy(img.GetPixelsBuffer(), dizzy_pixels, sizeof(dizzy_pixels)); // direct memory copy
                ImageWinViewer iwv(img);
                iwv.Show();

                return true;
            }
        }
        return false;
    }
};
int main()
{
    if (!Application::Init())
        return 1;
    Application::AddWindow(new MainWin());
    Application::Run();
    return 0;
}
